import { useQuery } from "@tanstack/react-query";
import { getFortune } from "@/apis/luck/luckAPI";

const useFortune = (isLogin: string) => {
  const { data } = useQuery(
    ["fortune"],
    () => {
      return getFortune();
    },
    {
      enabled: Boolean(isLogin),
      suspense: false,
    }
  );
  return data;
};

export { useFortune };
